import React from "react";

const App = () => {
  return (
    <>
      <h1 className="text-5xl flex align-text-top justify-center my-10">To-Do List App</h1>
      <div className=" flex justify-center">
      <form className="flex flex-col bg-slate-500 p-5 w-96 h-96 rounded-2xl ">
        <label htmlFor="task" className="text-2xl stroke-black">Task</label>
        <input type="text" id="task" className="border-2 my-2 w-84 h-10 p-1" placeholder="Enter the task..." /> <br />
      <button className="bg-green-800 text-yellow-500 w-32 h-10 rounded-xl">Add to List</button>
      </form>
      </div>
    </>
  );
};

export default App;
